    return (
        <>
            {/* <Topo /> */}
            <Container>
                <Subtitle>
                    <h1>Meus habitos</h1>
                    <button>+</button>
                </Subtitle>
                <p>Você não tem nenhum hábito cadastrado ainda. Adicione um hábito para começar a trackear!</p>
                {/* <Menu /> */}
            </Container>
        </>
    )
}

const Container = styled.div`
    background-color: #E5E5E5;
    width: 375px;

        p {
            font-size: 18px;
            padding-left: 17px;
            padding-right: 20px;
        }
    `
const Subtitle = styled.div`
    display: flex;
    justify-content: space-between;
    margin-bottom: 28px;


        h1 {
            font-size: 23px;
            color: var(--cor-subtitulo);
            padding-top: 28px;
            padding-left: 17px;
        }

        button {
            width: 40px;
            heigth: 35px;
            border-radius: 5px;
            margin-right: 18px;

            background-color: var(--cor-botao-footer)
        }



`

export default TelaHabitos;
